	private int[] bytetoint(byte[] array){
		int[] intarray = new int[array.length];
		for(int i=0; i<array.length; i++){
			intarray[i] = array[i];
		}
		return intarray;
	}
	
	private byte[] inttobyte(int[] array){
		byte[] bytearray = new byte[array.length];
		for(int i=0; i<array.length; i++){
			bytearray[i] = (byte) array[i];
		}
		return bytearray;
	}
